import styled from "styled-components";
import { useEffect } from "react";

const Gallery = () => {
  useEffect(() => {
    fetch("http://www.google.com")
      .then((response) => console.log(response))
      .catch((e) => console.log(e));
  });
  return (
    <div>
      <p>Gallery</p>
    </div>
  );
};
export default Gallery;
